import React from "react";
import { Redirect } from "react-router-dom";

function UserProfile(auth) {
  if (auth2 === true) {
    return <Redirect to="/login" />;
  } else {
    return <h1 className="red">Logged in </h1>;
  }
}
export default UserProfile;
